import LogItem from "./LogItem/LogItem";
import './Logs.css';
import Card from "./UI/Card/Card";

// 日志的容器
const Logs = (props) => {
        // {/* 模拟一组从服务器中加载的数据 */}
        
        // {/* 将数据放入JSX中 */}
        const logItemDate = props.logsData.map((item, index) => <LogItem logIndex={index} onDelLog={props.onDelLog} key={item.id} date={item.date} desc={item.desc} time={item.time}/>);

        return <Card className="logs">
            {
                logItemDate
            }
        </Card>
};
export default Logs;
